import { FETCH_PHOTO, TOGGLE_PHOTO } from '../actions/types';


const initialState = {
    photo: {},
    loading: true
}

//const initialState = loadState();

export default function(state = initialState, action) {
    switch(action.type) {
        case FETCH_PHOTO:
            //console.log('entered fetch photo reducer')
            return {
                ...state,
                photo: action.payload,
                loading: false
            }
        case TOGGLE_PHOTO:
            return state;
        default:
            return state;
    }
}
